import React from 'react'
import './Recent.css'
import Data from './obituaries.json'

const Recent = () => {
    return (
    <div className='recent'>
        {Data.map((item, id) => {
            return(
                <div>
                    <h1>{item.title}</h1>
                </div>
            )
        })}
    </div>
  )
}

export default Recent
